import { Card, Typography, Box } from '@mui/material';
import { ResponsivePie } from '@nivo/pie';
import SentimentSatisfiedAltIcon from '@mui/icons-material/SentimentSatisfiedAlt';
import SentimentNeutralIcon from '@mui/icons-material/SentimentNeutral';
import SentimentVeryDissatisfiedIcon from '@mui/icons-material/SentimentVeryDissatisfied';

const EmotionChart = ({ history }) => {
  if (history.length === 0) {
    return (
      <Card
        sx={{
          p: 3,
          height: '100%',
          minHeight: 400,
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          backgroundColor: theme =>
            theme.palette.mode === 'light'
              ? 'rgba(255,255,255,0.9)'
              : 'rgba(18,18,18,0.8)',
        }}
      >
        <Typography color="text.secondary">暂无数据</Typography>
      </Card>
    );
  }

  const sentimentCounts = history.reduce((acc, item) => {
    acc[item.sentiment] = (acc[item.sentiment] || 0) + 1;
    return acc;
  }, {});

  const data = [
    {
      id: 'positive',
      label: '正面',
      value: sentimentCounts.positive || 0,
      color: '#4caf50',
    },
    {
      id: 'neutral',
      label: '中性',
      value: sentimentCounts.neutral || 0,
      color: '#2196f3',
    },
    {
      id: 'negative',
      label: '负面',
      value: sentimentCounts.negative || 0,
      color: '#f44336',
    },
  ];

  return (
    <Card
      sx={{
        p: 3,
        height: '100%',
        minHeight: 400,
        backgroundColor: theme =>
          theme.palette.mode === 'light'
            ? 'rgba(255,255,255,0.9)'
            : 'rgba(18,18,18,0.8)',
      }}
    >
      <Typography variant="h6" sx={{ mb: 2 }}>情感分布</Typography>
      <Box sx={{ height: 300 }}>
        <ResponsivePie
          data={data}
          margin={{ top: 20, right: 20, bottom: 20, left: 20 }}
          innerRadius={0.6}
          padAngle={0.7}
          cornerRadius={3}
          activeOuterRadiusOffset={8}
          colors={{ datum: 'data.color' }}
          borderWidth={1}
          borderColor={{
            from: 'color',
            modifiers: [['darker', 0.2]],
          }}
          enableArcLinkLabels={false}
          arcLabelsSkipAngle={10}
          arcLabelsTextColor={{
            from: 'color',
            modifiers: [['darker', 2]],
          }}
          defs={[
            {
              id: 'dots',
              type: 'patternDots',
              background: 'inherit',
              color: 'rgba(255, 255, 255, 0.3)',
              size: 4,
              padding: 1,
              stagger: true,
            },
          ]}
          fill={[
            {
              match: {
                id: 'positive',
              },
              id: 'dots',
            },
            {
              match: {
                id: 'negative',
              },
              id: 'dots',
            },
            {
              match: {
                id: 'neutral',
              },
              id: 'dots',
            },
          ]}
          motionConfig="gentle"
          transitionMode="startAngle"
        />
      </Box>
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'center',
          gap: 3,
          mt: 2,
        }}
      >
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
          <SentimentSatisfiedAltIcon color="success" />
          <Typography variant="body2">
            正面: {((sentimentCounts.positive || 0) / history.length * 100).toFixed(1)}%
          </Typography>
        </Box>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
          <SentimentNeutralIcon color="info" />
          <Typography variant="body2">
            中性: {((sentimentCounts.neutral || 0) / history.length * 100).toFixed(1)}%
          </Typography>
        </Box>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 0.5 }}>
          <SentimentVeryDissatisfiedIcon color="error" />
          <Typography variant="body2">
            负面: {((sentimentCounts.negative || 0) / history.length * 100).toFixed(1)}%
          </Typography>
        </Box>
      </Box>
    </Card>
  );
};

export default EmotionChart;
